import React from 'react';

const InputField = ({ name, value, onChange, placeholder, onRemove }) => {
  return (
    <div className="inputWrapper">
      <input
        type="text"
        name={name}
        value={value}
        onChange={onChange}
        placeholder={placeholder}
        className="InputText"
      />
    </div>
  );
};

export default InputField;
